public Document normalise() {
    Element htmlEl = findFirstElementByTagName("html", this);
    if (htmlEl == null)
        htmlEl = appendElement("html");

    Element bodyEl = findFirstElementByTagName("body", htmlEl);
    if (bodyEl == null) {
        bodyEl = htmlEl.appendElement("body");
        moveTextNodesToBody(htmlEl, bodyEl);
    }

    Element headEl = findFirstElementByTagName("head", htmlEl);
    if (headEl == null) {
        headEl = htmlEl.prependElement("head");
        moveTextNodesToHead(htmlEl, headEl);
    }

    moveTextNodesToBody(headEl, bodyEl);
    moveTextNodesToBody(htmlEl, bodyEl);
    moveTextNodesToBody(this, bodyEl);

    return this;
}

private void moveTextNodesToBody(Element source, Element body) {
    List<Node> nodes = new ArrayList<>(source.childNodes());
    for (Node node : nodes) {
        if (node instanceof TextNode) {
            source.removeChild(node);
            body.appendChild(node);
        }
    }
}

private Element findFirstElementByTagName(String tagName, Element parent) {
    Elements elements = parent.getElementsByTag(tagName);
    return elements.isEmpty() ? null : elements.get(0);
