//The bug was fixed by rearranging the order in which the normaliseTextNodes method is called to ensure that text nodes are properly moved to the body element. This should prevent the issue of having two body elements in the tree.

/**
 * Normalise the document. This happens after the parse phase so generally does not need to be called.
 * Moves any text content that is not in the body element into the body.
 * @return this document after normalisation
 */
public Document normalise() {
    Element htmlEl = findFirstElementByTagName("html", this);
    if (htmlEl == null) {
        htmlEl = appendElement("html");
        appendElement("head").prependTo(htmlEl); // Move head element inside html element
        appendElement("body").appendTo(htmlEl); // Move body element inside html element
    } else {
        if (head() == null) {
            htmlEl.prependElement("head");
        }
        if (body() == null) {
            htmlEl.appendElement("body");
        }
    }

    // pull text nodes out of root, html, and head elements, and push into body. non-text nodes are already taken care
    // of. do in inverse order to maintain text order.
    normaliseTextNodes(head());
    normaliseTextNodes(htmlEl);
    normaliseTextNodes(this);

    return this;
}

